import React, { Component } from 'react';
import './Card.sass';

class Card extends Component {
  render() {
    return (
        <div className="card">
          <h3 className="card__title">Green cat - сайт защиты природы</h3>
          <h4 className="card__subtitle"></h4>
          
          <div className="card__members">
            <div className="member">
              <div className="member__img"></div>

              <div className="member-name">Олежа Дебилкин</div>
            </div>
          </div>

        </div>
    );
  }
}

export default Card;
